REPLACE INTO `cxm_email_template` VALUES (9,1,1,'Nurture Program','Financial Nurture','::Advanced Financial Integration with CXM','<div style=\"text-align: center;\">::image:NurtureFinancialIntegration.jpg::</div>',NULL,'KDesai','2014-01-17 14:31:37','SuperAdmin','2014-03-05 17:21:57'),(10,1,1,'Nurture Program','Marketing Nurture','::Customize Your Marketing Mix With CXM ','<div style=\"text-align: center;\">::image:NurtureMarketing.jpg::</div>',NULL,'KDesai','2014-01-17 14:35:21','KDesai','2014-01-17 14:45:17'),(11,1,1,'Nurture Program','Mobile Nurture','::CXM Goes Wherever You go','<div style=\"text-align: center;\">::image:NurtureMobile.jpg::</div>',NULL,'KDesai','2014-01-17 14:36:09','KDesai','2014-01-17 14:45:27'),(12,1,1,'Nurture Program','Outlook Nurture','::CXM Outlook Syncronization','<div style=\"text-align: center;\">::image:NurtureOutlook.jpg::</div>',NULL,'KDesai','2014-01-17 14:36:57','KDesai','2014-01-17 14:45:34'),(13,1,1,'Nurture Program','Service Nurture','::Improve Customer Satisfaction With CXM','<div style=\"text-align: center;\">::image:NurtureService.jpg::</div>',NULL,'KDesai','2014-01-17 14:37:57','KDesai','2014-01-17 14:45:43'),(14,1,1,'Nurture Program','Workflow Nurture','::Workflow Automation With CXM','<div style=\"text-align: center;\">::image:NurtureWorkFlowAutomation.jpg::</div>',NULL,'KDesai','2014-01-17 14:38:49','KDesai','2014-01-17 14:45:52'),(15,1,1,'Internal Notifications','Sales Information','Sales::Sales Status Changed to {[Sales:opportunityStatus]}','<font color=\"#ff0000\"><font color=\"#000000\"><font size=\"4\">Sales Opp: {[Sales:opportunityName]} <br /> Description: {[Sales:description]} <br /> Account: {[Sales:accountInSales]} <br /> Contact: {[Sales:contactInSales]}  <br /> Potential Value:  {[Sales:amountPerUnitPotential]}  <br /> Closed Value:  {[Sales:amountPerUnitActual]}  <br />Notes: <br />{[CustomNotes:details]}<br /></font></font></font>',NULL,'KDesai','2014-01-27 16:56:57','SuperAdmin','2014-03-24 12:18:55'),(16,1,1,'Internal Notifications','New Lead Information','Leads::New Lead Assigned {[Leads:Account]}','<font color=\"#ff0000\"><font color=\"#000000\"><font size=\"4\">Hi,<br /><br />Here is information on a New Lead:<br /><br />Account Name: {[Leads:Account]}<br />First Name: {[Leads:firstName]}<br />Last Name: {[Leads:lastName]}<br />City: {[Leads:City]}<br />State: {[Leads:State]}<br />Phone Number: {[Leads:Phone]}<br />Lead Notes: {[Leads:leadNotes]}<br /><br />Thank you</font></font></font>',NULL,'KDesai','2014-01-27 16:56:57','KDesai','2014-02-04 16:05:09'),(17,1,1,'Lead drip campaign','Lead Drip Campaign 1','Leads::CRM Referral from {[Leads:source]}','<div style=\"text-align: center;\"> ::image:resized.jpg:: <font size=\"3\"><i><b> <br> <br> Grow Your Business <br> <br> Without Giving Up Control</b></i></font> </div> <font size=\"3\">&nbsp; <br> <br> Hi {[Leads:firstName]}, <br> <br> My name is Randi, and you were referred to us by {[Leads:source]} because we believe our CXM software is a good fit for your company based upon your needs. Our company, Creedenz Solutions specializes in custom Customer Relationship Management solutions better known as CRM. <br> <br> We offer a feature-rich Web or On-Premise CRM system called CXM. Our Workflow Automation and Lead Management modules are very comprehensive and allow you to customize the program to best fit your needs. <br> <br> CXM is capable of creating a series of simple and advanced automated rules that manage your leads, ensure that sales opportunities are never missed, and much, much more. We also offer a Web Portal that allows your customers to log-in and create a new ticket, check the status of an existing ticket, download files, search a knowledge base, and more. Field Based Personnel can access the data they need with a laptop, tablet, or even their smart phone - all in real time. <br> <br> We have the best in class Outlook integration for Windows and Mac as well as integration with countless other 3rd party applications; eliminating the need for additional investments in new hardware or infrastructure. <br> <br> To get us started, I have attached a CXM brochure to this email for your review. Please have a look at our website <a href=\"www.creedenz.com\" target=\"_self\">www.creedenz.com</a> for a general idea of how we compare to other CRM companies, I know you will be pleased with the value we offer. <br> <br> I would like to show you a personal demonstration of CXM, when is a convenient time for you? <br> <br> Please feel free to email or to call me with any questions, or I will follow-up with you by phone to see if we can schedule a time to talk about your specific needs and set up a web-demo for you. <br> <br> Have a great day! <br> <br> Kind Regards, <br> <br> Randi Verin <br> Account Manager <br> Creedenz Solutions <br> (855) 4-CXMCRM <br> 951-999-4195 Direct <br> <a href=\"www.creedenz.com\" target=\"_self\">www.creedenz.com</a></font> ',NULL,'KDesai','2014-01-27 17:09:10','SuperAdmin','2014-09-13 09:58:37'),(18,1,1,'Lead drip campaign','Lead Drip Campaign 2','Leads::What can CXM do for you?','<div style=\"text-align: center;\"> ::image:resized.jpg:: <br> <br> <div style=\"text-align: left;\"> <font size=\"3\">Hi {[Leads:firstName]}, <br> <br> Would you like to see your business run smoothly? Did you know that CXM offers more features and better return on investment (ROI) than other CRM companies?&nbsp; CXM has a very robust set of features that our customers love, they have a product that grows with them! Features like sales automation, marketing automation, in-depth analytic, workflow automation, quotes, built in reporting, and social media integration (to name a few) are standard with CXM. Efficiency, affordability, scalability, flexibility and an amazing value that exceeds the industry standard is part of the package we call CXM. <br> <br> Visit our website www.creedenz.com or call us today at (855) 4-CXMCRM to learn about how CXM, can enhance your business. <br> <br> Hope you have a nice day! <br> &nbsp; <br> Kind Regards, <br> <br> Randi Verin <br> Account Manager <br> Creedenz Solutions <br> (855) 4-CXMCRM <br> 951-999-4195 Direct <br> <u>www.creedenz.com</u></font> <br> </div> </div> ',NULL,'KDesai','2014-01-27 17:28:15','SuperAdmin','2014-09-13 10:24:23'),(19,1,1,'Lead drip campaign','Lead Drip Campaign 3','Leads::CXM can make the difference','<div style=\"text-align: center;\"> <div style=\"text-align: center;\"> ::image:resized.jpg:: <br> <br> <div style=\"text-align: left;\"> <font size=\"3\">Hi {[Leads:firstName]}, <br> <br> We recently contacted you to share some of the features and value that CXM brings to the table. <br> <br> CXM is a robust, highly configurable, and easy to use solution that is built to fit your needs - at a fraction of the cost and time associated with other CRM companies. CXM is designed to be the most flexible and adaptable CRM software on the market today. With CXM, every component can be reconfigured to perfectly support your processes without the overhead. <br> <br> I would like to provide a demonstration of CXM and show you the value and benefits that CXM can provide for your company. Please email or call me at (855) 4-CXMCRM and I will be glad to schedule a demo or answer any of your questions. <br> Thank you! <br> <br> Empower your business, think CXM. <br> <br> <br> Kind Regards, <br> <br> Randi Verin <br> Account Manager <br> Creedenz Solutions <br> (855) 4-CXMCRM <br> 951-999-4195 </font><font size=\"3\"><font size=\"3\">Direct <br> </font><u>www.creedenz.com</u></font> <br> <br> </div> </div> </div> ',NULL,'KDesai','2014-01-27 17:31:08','SuperAdmin','2014-09-12 14:25:26'),(20,1,1,'Lead drip campaign','Lead Drip Campaign 4','Leads::CRM Shouldn\'t Be Complicated','<p align=\"center\" style=\"text-align:center;\"> ::image:resized.jpg:: <br> </p> <br> <font size=\"3\">Hi {[Leads:firstName]}, <br> <br> I am following up with you to see if you are still interested in scheduling a demonstration of CXM. <br> &nbsp; <br> CXM is engineered specifically to meet the challenges of day-to-day business while offering exceptional customization and back office integration and automation, as well as unlimited reporting power- all part of the base package. <br> <br> I would like to schedule some time to talk with you regarding the challenges you currently face. <br> <br> I know your time is at a premium, I completely understand! This is why we have designed CXM to give you the freedom and time to empower you so you do more of what you do best. <br> &nbsp; <br> When would be a good time to reach you to schedule a demonstration of CXM? <br> Hope you have a fantastic day! <br> <br> Empower your business, think CXM. <br> <br> Randi Verin <br> Account Manager <br> Creedenz Solutions <br> (855) 4-CXMCRM <br> 951-999-4195 Direct <br> www.creedenz.com <br> </font> ',NULL,'KDesai','2014-01-27 17:33:25','KDesai','2014-06-09 11:15:45'),(21,1,1,'Lead drip campaign','Lead Drip Campaign 5','Leads::Think CXM','<p align=\"center\" style=\"text-align:center;\"> ::image:resized.jpg:: <br> </p> <br> Hi {[Leads:firstName]}, <br> <br> CXM is still here! I encourage you to schedule an appointment for a demonstration of the capabilities and value of CXM. <br> <br> If you believe that CXM is the correct CRM solution for your business, please feel free to contact me at (855) 4-CXMCRM. <br> <br> CRM; when you\'re ready to run business your way <br> <br> Hope you have a great week ahead! <br> <br> Randi Verin <br> Account Manager <br> Creedenz Solutions <br> (855) 4-CXMCRM <br> 951-999-4195 Direct <br> www.creedenz.com ',NULL,'KDesai','2014-01-27 17:35:34','KDesai','2014-06-09 11:17:43'),(26,1,1,'Reminders','Day Before Appointment Reminder','Activity::REMINDER: CXM Demo Appointment Tomorrow','<div style=\"text-align: center;\">::image:resized.jpg::<br /></div><font size=\"3\">Hello,<br /><br />This is a reminder that you have an appointment scheduled for tomorrow at {[activity:fromTime]} for a demonstration of CXM. We look forward to showing you the flexibility and benefits that CXM can provide for you.<br /><br />Below are the details of your CXM Demo appointment. If you have any questions, please do not hesitate to contact me.<br /><br />{[activity:notes]}  <br /> <br /><br />Kind Regards,<br /> <br />Randi Verin<br />Account Manager<br />Creedenz Solutions<br />(855) 4-CXMCRM<br />951-999-4195 Direct<br /><u>www.creedenz.com</u></font><br />',NULL,'KDesai','2014-01-28 16:16:10','KDesai','2014-03-03 16:38:36'),(27,1,1,'Reminders','Demo Appointment Confirmation','Activity::CXM Demo Confirmation ','<div style=\"text-align: center;\">::image:resized.jpg::<br /></div><font size=\"3\">Hello,<br /><br />This is a confirmation email for your CXM demo appointment. Your appointment is scheduled for {[activity:fromDate]} at {[activity:fromTime]}. We look forward to demonstrating the flexibility and benefits that CXM offers. If you wish to reschedule or cancel your appointment, please contact us by email or phone (855) 4-CXMCRM.  <br /><br />Below are the details of your CXM Demo appointment:<br /><br />{[activity:notes]}   <br /> <br /><br />Kind Regards,<br /> <br />Randi Verin<br />Account Manager<br />Creedenz Solutions<br />(855) 4-CXMCRM<br />951-999-4195 Direct<br /><u>www.creedenz.com</u></font><br /><br />',NULL,'KDesai','2014-01-28 16:25:36','KDesai','2014-03-03 16:41:25'),(29,1,1,'Reminders','Demo Rescheduled','Activity::CXM Demo has been rescheduled','<div style=\"text-align: center;\">::image:resized.jpg::<br /></div><br /><font size=\"3\">Hello,<br /><br /> Your appointment has been rescheduled for {[activity:fromDate]} at {[activity:fromTime]}. If you wish to reschedule or cancel your appointment, please contact us by email or phone (855) 4-CXMCRM.  <br /><br />Below are the details of your CXM Demo appointment:<br /><br />{[activity:notes]}   <br /> <br /><br />Kind Regards,<br /> <br />Randi Verin<br />Account Manager<br />Creedenz Solutions<br />(855) 4-CXMCRM<br />951-999-4195 Direct<br /><u>www.creedenz.com </u></font><br />',NULL,'KDesai','2014-01-31 16:29:09','KDesai','2014-03-03 16:43:42'),(30,1,1,'Reminders','Appointment Cancelation','Activity::CXM Appointment Canceled','<div style=\"text-align: center;\">::image:resized.jpg::<br /></div><font size=\"3\">Hello,<br /><br />This email is to confirm that we have successfully canceled your previously scheduled appointment of {[activity:fromDate]}. If you have any questions pertaining to the cancellation of your appointment, please call us at 1-855-4CXMCRM.<br /><br />Thank You,<br /> <br /><br />Randi Verin<br />Account Manager<br />Creedenz Solutions<br />(855) 4-CXMCRM<br />951-999-4195 Direct<br /><u>www.creedenz.com</u></font><br /><br /><p><br /></p>',NULL,'SuperAdmin','2014-02-26 17:20:52','KDesai','2014-03-03 16:45:10'),(40,1,1,'Holiday Templates','New Years','Contact::Happy New Year!','<div style=\"text-align: center;\">::image:newyears.jpg::<br /><div style=\"text-align: left;\"><font size=\"3\">Dear {[Contact:firstName]},</font><br /></div><div style=\"text-align: left;\"><br /><font size=\"3\">Lorem ipsum dolor sit   amet, consectetur adipiscing elit. Vivamus id   dictum nibh. Donec erat   turpis, tristique a tempor non, fermentum ac   arcu. Aenean vulputate   laoreet risus placerat pulvinar. Proin nec ipsum   eros. Suspendisse sit   amet fringilla metus. Nulla vehicula nibh   consectetur, fermentum enim   et, mollis sapien. Praesent dignissim magna   non purus congue lacinia   vitae ac magna. Suspendisse facilisis tempor   luctus. Sed eget lobortis   ipsum. Duis sodales ante vel diam ultricies   suscipit. Fusce quis leo   non libero condimentum ultrices. Cras vehicula,   ante quis faucibus   varius, velit ipsum tempor ipsum, eget commodo enim   enim eu urna.   Vestibulum vitae tristique urna, viverra rhoncus est.   </font><br /></div><br /><br /><br /><div style=\"text-align: center;\"><font size=\"3\">The Acme Company </font><br /><