   pellentesque porta. <br /></font></p><font size=\"3\"></font><p><font size=\"3\"><br />Kind Regards,<br /><br />{[Leads:AssignedTo]}</font><br /> <br /></p><div style=\"text-align: center;\"><font size=\"2\">The Acme Company </font><br /><font size=\"2\"> </font><br /><font size=\"2\">Phone: 555-5555</font><br /><font size=\"2\">Fax: 555-1234</font><br /><font size=\"3\"><font size=\"2\">Email: Acme@gmail.com </font> </font></div></div></div>',NULL,'KDesai','2014-05-05 14:46:53','KDesai','2014-05-05 14:47:27'),(63,1,1,'SO','SOWon','Sales::Welcome to Creedenz','Welcome to the Creedenz family, we are excited to serve you and provide the best software implementation possible. I would like to set up our first meeting in three days to discuss our first steps towards your CXM installation. Please let me know your availability and time that works best for you so we can schedule our first meeting. The general agenda for all the meetings can be found in our two documents, one is an overview of the Discovery process, the other addresses the Project Phases (*see attachments) associated with your CXM project. <br> <br> For meeting #1 <b>we will schedule a join.me </b>or<b> GoToMeeting</b></span> and use the call in conference call number to kick off the project. If the date we’ve suggested does not fit into your current schedule, please let us know and provide us with a couple of alternative dates and or times that will work better with your current commitments. <br> <br> We appreciate your business and look forward to mutually rewarding relationship with {[Sales:accountInSales]} <br> <br> Timothy J. Smith <br> Chief Operating Officer<br> Creedenz Solutions, Inc. <br> (951) 999-4210',NULL,'SuperAdmin','2014-08-15 09:31:51','SuperAdmin','2014-09-12 13:54:51'),(64,1,1,'Ticket','NewTicket','TicketSimple::A {[TicketSimple:urgency]} Support Ticket ({[TicketSimple:ticketID]}) from {[TicketSimple:account]}','Primary contact: {[TicketSimple:primarycontact]}\r\n<br>\r\n<br>\r\n&nbsp;Primary contact phone number: {[TicketSimple:primaryphone]}\r\n<br>\r\n<br>\r\n&nbsp;Primary contact email: {[TicketSimple:email]}\r\n<br>\r\n<br>\r\n&nbsp;Received date &amp; time: {[TicketSimple:recdDate]} {[TicketSimple:recdTime]}\r\n<br>\r\n<br>\r\n&nbsp;Ticket type: {[TicketSimple:typeCall]}\r\n<br>\r\n<br>\r\n&nbsp;Category &amp; sub-category: {[TicketSimple:category]} {[TicketSimple:subcategory]}\r\n<br>\r\n<br>\r\n&nbsp;Problem description: {[TicketSimple:probDesc]}\r\n',NULL,'SuperAdmin','2014-08-15 13:10:42','SuperAdmin','2014-09-12 14:19:39'),(65,1,1,'Ticket','NewTicketIssue','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} Created','I am sorry about the difficulties you are experiencing with CXM. I am talking with the team to determine how we can solve your problem as quickly as possible. I will make sure we keep you updated (remember you can always visit our Self-Service Portal to see the latest status on you ticket in case I get super busy). If this doesn’t work or you have more questions, just let me know and I’ll be happy to help!\r\n',NULL,'SuperAdmin','2014-08-26 10:17:02','SuperAdmin','2014-08-27 09:08:03'),(66,1,1,'Ticket','TicketSuggestion','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} Suggestion','You are awesome! Thank you for taking the time out of your busy day to give us your suggestion. I will be sharing your suggestion with the team this week, so if we have any follow-up questions we will be contacting you. Thank you!\r\n<br>\r\n<br>\r\nTom Fryer\r\n',NULL,'SuperAdmin','2014-08-26 10:17:43','SuperAdmin','2014-08-27 09:07:31'),(67,1,1,'Ticket','TicketHowTo','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} How To','Let me look into this and I will have one of our awesome support team members that understands what you are doing get back to you as quickly as possible and answer your question or schedule a session with you and so you get the answers you need! Phew! &nbsp;\r\n<br>\r\n<br>\r\nTim Smith\r\n',NULL,'SuperAdmin','2014-08-26 10:19:58','SuperAdmin','2014-08-27 09:06:36'),(68,1,1,'Ticket','TicketEnchancement','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} Enhancement Request','Frist, thank you for using CXM and thinking enough of us to offer your Enhancement Request! I would be delighted to pitch your enhancement request to the team and see what they think. If you have any other questions, just let me know and I’ll be happy to help. And have a fantastic day!\r\n<br>\r\n<br>\r\nTim Smith\r\n',NULL,'SuperAdmin','2014-08-26 10:21:17','SuperAdmin','2014-08-27 09:05:30'),(69,1,1,'Ticket','TicketTraining','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} Training Request','Glad to hear that you are interested in receiving training from our awesome support team. Let me find out our availability and I will contact you again and give you a few options. How cool is that!\r\n<br>\r\n<br>\r\nTim Smith\r\n',NULL,'SuperAdmin','2014-08-26 10:22:31','SuperAdmin','2014-08-27 09:04:00'),(70,1,1,'Ticket','TicketClosed','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} Closed! Yea!!!','Guess what? Your ticket has been closed! Thank you again with your patience with us. I know it’s never convent when an issue occurs, but thank you for working with us to resolving this issue and hopefully making your day a little brighter! Have an awesome day!\r\n<br>\r\n<br>\r\nYour Friendly Support Team at Creedenz (Support@creedenz.com)\r\n',NULL,'SuperAdmin','2014-08-26 10:24:29','SuperAdmin','2014-08-27 09:03:23'),(71,1,1,'Ticket','TicketReOpened','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} Re-Opened','Whoops! Sometimes things happen. And apparently, this isn’t our day. I apologize that we had to re-open your ticket. I promise we will do our very best to solve this issues. In the meantime, if you have any questions please feel free to contact me. I’ll be happy to help!\r\n<br>\r\n<br>\r\n<span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\">Tim Smith</font></span>\r\n',NULL,'SuperAdmin','2014-08-26 10:25:37','SuperAdmin','2014-08-27 09:02:15'),(72,1,1,'Ticket','TicketOnHold','TicketSimple::CXM Support Ticket {[TicketSimple:ticketID]} On-Hold','Hi, Thank you again for your support and patience! We had to place your ticket on hold. Give me a little time to talk with the support team and find out the situation. I will give you an update as soon as I understand why you ticket was placed on-hold.\r\n<br>\r\n<br>\r\nTim Smith\r\n',NULL,'SuperAdmin','2014-08-26 10:26:51','SuperAdmin','2014-08-27 09:00:51'),(73,1,1,'Ticket','TicketAssignedSynergy','TicketSimple::{[TicketSimple:urgency]} CXM Ticket {[TicketSimple:ticketID]} Assigned. ','<span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\"><font size=\"3\"><span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\">Hi {[TicketSimple:assignedTo]}, &lt;p&gt;Ticket {[TicketSimple:ticketID]} has been assigned to you, the basic details of this ticket are included below&lt;/p&gt; &lt;/p&gt; {[TicketSimple:urgency]}&lt;/p&gt;&lt;p&gt;{[TicketSimple:typeCall]}&lt;/p&gt;&lt;p&gt;{[TicketSimple:account]} {[TicketSimple:contact]}&lt;/p&gt;&lt;p&gt;{[TicketSimple:probDesc]}&lt;/p&gt;</font></span>\r\n<br>\r\n&nbsp;\r\n<br>\r\n</font></font></span><span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"></span><span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\"><span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\">{[TicketSimple:userId]} </font></span></font></span>\r\n',NULL,'SuperAdmin','2014-08-26 10:30:02','SuperAdmin','2014-08-27 08:59:30'),(74,1,1,'Ticket','TicketAssigned','TicketSimple::{[TicketSimple:urgency]} CXM Ticket {[TicketSimple:ticketID]} Assigned. ','<span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\">Hi {[TicketSimple:assignedTo]}, &lt;p&gt;Ticket {[TicketSimple:ticketID]} has been assigned to you, the basic details of this ticket are included below&lt;/p&gt; &lt;/p&gt; {[TicketSimple:urgency]}&lt;/p&gt;&lt;p&gt;{[TicketSimple:typeCall]}&lt;/p&gt;&lt;p&gt;{[TicketSimple:account]} {[TicketSimple:contact]}&lt;/p&gt;&lt;p&gt;{[TicketSimple:probDesc]}&lt;/p&gt;\r\n<br>\r\n<br>\r\n{[TicketSimple:userId]}&nbsp;                </font></span><span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\"><span style=\",&quot; Calibri&quot; font-family: &quot; line-height: 115%; sans-serif&quot;\"><font size=\"3\"> </font></span></font></span>\r\n',NULL,'SuperAdmin','2014-08-26 10:33:21','SuperAdmin','2014-08-27 08:57:18'),(75,1,1,'Lead drip campaign','Lead Drip Campaign 0','Leads::Thank You','<div style=\"text-align: center;\"> ::image:resized.jpg:: &nbsp; <font size=\"3\"><i><b> <br> <br> Grow Your Business <br> <br> Without Giving Up Control </b></i></font> </div> <font size=\"3\">&nbsp; <br> <br> Hi {[Leads:firstName]}, <br> <br> Thank you for reaching out to {[Leads:source]}, they sent us your information and thought that our product might be a good match for your needs <br> <br> Our product, CXM, is a robust, feature rich CRM (Customer Relationship Management) Plus platform that utilizes an Adaptive Data Engine (ADE) that will make life easier for your company and customers at a fraction of the time and money compared to our competitors. <br> <br> Our mission at Creedenz Solutions is to provide you a system that solves your problems, provide a simple and clean interface, and make life easier for you and your customers. Our team of professionals are willing to do whatever it takes to make sure that CXM exceeds your expectations. <br> <br> I will be assigning a salesperson to answer your questions, so expect them to reach out to you shortly. If there is anything else I can do to earn your business, please don\'t hesitate to reach out to me, we are here to do everything we can to help you succeed. <br> <br> <br> Sincerely, <br> <br> Dr. Thomas M. Fryer <br> CEO <br> Creedenz Solutions <br> (855) 4-CXMCRM <br> <a href=\"www.creedenz.com\" target=\"_self\">www.creedenz.com</a></font> ',NULL,'KDesai','2014-01-27 17:09:10','SuperAdmin','2014-09-13 10:03:29');
